import React from 'react';
import '../css/FontAwesome.css';

function Skills() {
  return(
    <div className="skills-icons">
      <i className="fab fa-git-alt"></i>
      <a href="#" className="outer-shadow skills-icons"><i className="fab fa-linux"></i></a>
      <a href="#" className="outer-shadow skills-icons" ><i className="fab fa-html5"></i></a>
      <a href="#" className="outer-shadow skills-icons" ><i className="fab fa-css3-alt"></i></a>
      <a href="#" className="outer-shadow skills-icons" ><i className="fab fa-js"></i></a>
      <a href="#" className="outer-shadow skills-icons" ><i className="fab fa-react"></i></a>
      <a href="#" className="outer-shadow skills-icons" ><i className="fab fa-database"></i></a>
      <a href="#" className="outer-shadow skills-icons" ><i className="fab fa-server"></i></a>
      <a href="#" className="outer-shadow skills-icons" ><i className="fab fa-node-js"></i></a>
    </div>
  );
}

export default Skills;
